function isWallAtColRow(col, row) {
    if (col >= 0 && col < WALL_COLS && row >= 0 && row < WALL_ROWS) {
        var wallIndexUnderCoord = rowColToArrayIndex(col, row);
        return (wallGrid[wallIndexUnderCoord] === 1);
    } else {
        return false;
    }
}

function rowColToArrayIndex(col, row) {
    return col + WALL_COLS * row;
}

let moving = false;
let nextMoving = false;
function keyPressed(event) {
    if (event.keyCode === KEY_LEFT) {
        keyHeldLeft = true;
    } else if (event.keyCode === KEY_RIGHT) {
        keyHeldRight = true;
    } else if (event.keyCode === KEY_UP) {
        keyHeldUp = true;
    } else if (event.keyCode === KEY_DOWN) {
        keyHeldDown = true;
    }
    if (keyHeldLeft || keyHeldRight || keyHeldUp || keyHeldDown) nextMoving = true;
    if(!moving && nextMoving) {
        munch.play();
    }
    moving = nextMoving;
    event.preventDefault();
}

function keyReleased(event) {
    if (event.keyCode === KEY_LEFT) {
        keyHeldLeft = false;
    } else if (event.keyCode === KEY_RIGHT) {
        keyHeldRight = false;
    } else if (event.keyCode === KEY_UP) {
        keyHeldUp = false;
    } else if (event.keyCode === KEY_DOWN) {
        keyHeldDown = false;
    }
    if (!(keyHeldLeft || keyHeldRight || keyHeldUp || keyHeldDown)) nextMoving = false;
    if(moving && !nextMoving) {
        munch.pause();
    }
    moving = nextMoving;
    event.preventDefault();
}

function animate() {
    var framesPerSecond = 30;
    updateAll();
    updateSometimes();
    if (ghostBlue) {
        normalMode();
    }
    setTimeout( () => requestAnimationFrame(animate), 1000/framesPerSecond)
}

